window.onload=()=>{DarkReader.setFetchMethod(window.fetch);let e=document.querySelector("#switcher"),l=document.querySelector("#screenshot1"),d=document.querySelector("#screenshot2");e.addEventListener("click",()=>{DarkReader.isEnabled()?(l.style.display="block",d.style.display="none",DarkReader.disable()):(l.style.display="none",d.style.display="block",DarkReader.enable())})};